bOnly: '0', highResImg: true, carePassEligible: false, description: "<p>There's hair color, then there's Preference color. Our gold standard for beautiful color and shine that defies fade out for up to 8 weeks. With Superior Preference luminous color shines from every strand. The fade defying color and shine system includes our care Supreme conditioner, with shine serum, vitamin E, and UV filter locks in first day color vibrancy and provides soft, luxuriously silky hair<ul><li>Care Supreme conditioner with shine serum</li><li>In over 50 light reflecting shades.</li></ul></p>", directions: 'Store between 50 F and 80 F. Directions: 1. Mix color: Put on gloves, twist off the tip of the color optimizing creme (1) Applicator cap before beginning, remove cap from bottle, pour entire contents of color gel (2) Bottle into color optimizing creme (1) Applicator bottle and replace applicator cap securely. Place your gloved finger over open tip. Point away from your face and shake thoroughly until mixture is totally blended. 2. Apply color, time and rinse. Option A: Root application touch up: 1. Touch up root area first 2. Apply to rest of the hair 3. Time 4. Rinse out until water runs clear 5. Condition and recondition weekly with our care supreme color saving conditioner. Option B: Full head application: 1. Apply all over 2. Time 3. Rinse out until water runs clear 4. Condition and recondition weekly with our care supreme color saving conditioner.', ingredients: 'Ingredients: Aqua/Water, Trideceth-2 Carboxamide Mea, Propylene Glycol, Hexylene Glycol, PEG-2 Oleamine, Polyglyceryl-4 Oleyl Ether, Oleyl Alcohol, Alcohol Denat., Ammonium Hydroxide, Polyglyceryl-2 Oleyl Ether, Oleic Acid, Sodium Diethylaminopropyl Cocoaspartamide, Pentasodium Pentetate, Ammonium Acetate, Parfum/Fragrance, Sodium Metabisulfite, 2-Methyl-5-Hydroxyethylaminophenol, P-Aminophenol, Erythorbic Acid, Resorcinol, P-Phenylenediamine, Alpha-Isomethyl Ionone, Eugenol, 6-Hydroxyindole, Linalool, Citronellol. F.I.L. #D33277/2. Color optimizing creme: Aqua/Water, Hydrogen Peroxide, Cetearyl Alcohol, Trideceth-2 Carboxamide Mea, Ceteareth-30, Glycerin, Pentasodium Pentetate, Sodium Stannate, Tetrasodium Pyrophosphate. F.I.L. #D56/21. Care Supreme conditioner: Aqua/Water, Cetearyl Alcohol, Glycerin, Behentrimonium Chloride, Candelilla Cera/Candelilla Wax/Cire De Candelilla, Amodimethicone, Cetyl Esters, Isopropyl Alcohol, Lecithin, Tocopherol, Oleth-10, Phenoxyethanol, PPG-5-Ceteth-20, Ethylhexyl Salicylate, Ethylparabentrideceth-12, Chlorhexidine Dihydrochloride, Limonene, Camelina Sativa Oil/Camelina Sativa Seed Oil, Linalool, Benzyl Alcohol, Benzyl Benzoate, Phosphoric Acid, Parfum/Fragrance, Geraniol, Disodium Cocoamphodipropionate, Methylparaben, Cetrimonium Chloride, Butylphenyl Methylpropional, Citronellol, Hexyl Cinnamal, Amyl Cinnamal. F.I.L. #D42419/2.', warnings: 'Important: Haircolor can cause an allergic reaction which, in certain rare cases, can be severe. Therefore, you must follow these precautions: Do not use if: You have already had a reaction to a haircolor product, you have a sensitive, itchy or damaged scalp. If you have a tattoo, the risks of allergic reaction may be increased. Perform a skin allergy test 48 hours before each use of this product (see insert). Remember to buy your product 2 days ahead of time. Avoid contact of this product with eyes and skin. If product gets into eyes, rinse immediately. Wear gloves provided in kit. Thoroughly rinse hair after application. Do not use over compound henna or progressive color. Wait at least 14 days after bleaching, relaxing or perming before coloring. Keep product out of the reach of children. Do not apply on children. This product contains ingredients which may cause skin irritation on certain individuals and a preliminary test according to accompanying directions should first be made. This product must not be used for dyeing the eyelashes or eyebrows, to do so may cause blindness.', twoDayShipping: true,